import React from "react";

const Footer = ({title , array_of_child})=>{

    return(
        <div>
            <div className="title">
                {title} 
            </div>
            <div className="bottom">
                {array_of_child.map(val=>(
                    <p>{val}</p>
                ))}
            </div>
        </div>
    )
}

export default FooterChild ;
